import Home from './routes/home/home.component';
import { Outlet, Route, Routes } from 'react-router-dom';


const Navigation = () => {
  return (
    <div>
      <div>
        <h1>
          This is the Navigation!
        </h1>
        <Outlet />
      </div>
    </div>
  );
}

const Shop = () => {
  return (
    <h1>This is the Shop Page!!</h1>
  );
}

const App = () => {
  return (
    <Routes>
      <Route path='/' element={<Home />}>
        <Route path='shop' element={<Shop />} />
      </Route>
    </Routes>
  );
}

export default App;
